import { Link } from "react-router-dom";

function SideBar (){
    return (
        <div>
            <div className="sidebar">
                <ul className="nav">
                        <Link to="/">Home</Link>
                        <br></br>
                        <Link to="/profile">Profile</Link>

                </ul>
            </div>
        </div>
    )
}

export default SideBar
